// src/components/Navbar.js
import React, { useState } from 'react';
import './Navbar.css';
import navlogo from '../../assets/nav-logo.svg';
import navprofile from '../../assets/nav-profile.svg';
import homebutton from '../../assets/homebutton.png';
import Sidebar from '../';

const Navbar = () => {
  const [sidebarVisible, setSidebarVisible] = useState(false);

  const toggleSidebar = () => {
    setSidebarVisible(!sidebarVisible);
  };

  return (
    <div className="navbar">
      <div className="navbar__logo-button">
        <img src={navlogo} alt="Brand Logo" className="navlogo" />
        <img src={homebutton} alt="Home Button" className="buttonclass" onClick={toggleSidebar} />
      </div>
      <img src={navprofile} alt="User Profile" className="navprofile" />
      <Sidebar show={sidebarVisible} onClose={toggleSidebar} />
    </div>
  );
};

export default Navbar;
